import{_ as e,o as r,c as a,O as t}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 19.2-392.01 Judges may require taking of fingerprints and photographs in certain misdemeanor cases.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/19.2-392.01.md","filePath":"vacode/19.2-392.01.md"}'),i={name:"vacode/19.2-392.01.md"},n=t('<h1 id="§-19-2-392-01-judges-may-require-taking-of-fingerprints-and-photographs-in-certain-misdemeanor-cases" tabindex="-1">§ 19.2-392.01 Judges may require taking of fingerprints and photographs in certain misdemeanor cases. <a class="header-anchor" href="#§-19-2-392-01-judges-may-require-taking-of-fingerprints-and-photographs-in-certain-misdemeanor-cases" aria-label="Permalink to &quot;§ 19.2-392.01 Judges may require taking of fingerprints and photographs in certain misdemeanor cases.&quot;">​</a></h1><p>The judge of a district court may, in his discretion, on motion of the attorney for the Commonwealth, require the duly constituted police officers of the county, city or town within the territorial jurisdiction of the court to take the fingerprints and photograph of any person who has been arrested and charged with a misdemeanor other than a misdemeanor which is a violation of any provision of Title 46.2.</p><p>1995, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?951+ful+CHAP0407" target="_blank" rel="noreferrer">407</a>; 1996, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?961+ful+CHAP0755" target="_blank" rel="noreferrer">755</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?961+ful+CHAP0914" target="_blank" rel="noreferrer">914</a>.</p>',3),o=[n];function s(c,h,d,p,g,f){return r(),a("div",null,o)}const _=e(i,[["render",s]]);export{m as __pageData,_ as default};
